import React from "react";
import { NavLink } from "react-router-dom";

const Navbar = () => {

  return (
    <div class="full-block">
      <div class="block-1"><p>Trang Do</p></div>

    <div className="block-2">
        <NavLink 
        to={"/"}
        style={ ({isActive}) => (
        isActive ? linkStyles.activeLink : linkStyles.defaultLink
    )}>
        _hello
        </NavLink>

        <NavLink
        to="/"
        style={ ({isActive}) => (
            isActive ? linkStyles.activeLink : linkStyles.defaultLink
            )}>
        _about-me
        </NavLink>

        <NavLink
        to="/"
        style={ ({isActive}) => (
            isActive ? linkStyles.activeLink : linkStyles.defaultLink
            )}>
        _projects
        </NavLink>
      </div>
      <div class="block-3">
      <NavLink
        to="/"
        style={ ({isActive}) => (
            isActive ? linkStyles.activeLink : linkStyles.defaultLink
            )}>
        _contact-me
        </NavLink>
      </div>
      </div>
      );


}

export default Navbar;

const linkStyles = {
  activeLink: {
    color: "blue",
  },
  defaultLink: {
    textDecoration: "none",
    color: "white",
  },
};
